import React from 'react';
import data from './data/products.json';
import { Redirect } from 'react-router-dom';
import './App.css';


const ProductPage = ({match}) => {

    const product = data.find(product => {
        return match.params.id === product.id;
    })

    return(
        <div style={{marginTop: 100}} className="container">
            {product !== undefined 
            ? <div className="container" id="frame">
                <div id="photo-frame">
                    <div className="big-photo-div">
                        <button className="prev-button"><i class="fas fa-chevron-left"></i></button> 
                        <img src={product.images[0]} alt="" id="product-big-image"></img>
                        <button className="next-button"><i class="fas fa-chevron-right"></i></button> 
                        <p id="photo-desc"><span>very good very fdjsaşlf dsaş jsa (8/10)</span></p>
                    </div>
                    <div className="small-photo-div">
                        <ul>
                            <li>
                                <img src={product.images[0]} alt="" id="product-small-img"></img>
                            </li>
                            <li>
                                <img src={product.images[0]} alt="" id="product-small-img"></img>
                            </li>
                        </ul>
                    </div>
                </div>
                <div id="saler-frame">
                    
                </div> 
            </div>
                     
            : <Redirect to="/notfound"></Redirect>} 
        </div>
    )   
                 
}

export default ProductPage;
